import './ExpenseItem.css';
function ExpenseItem(){
    return (
        <div>
            <div className="expense-item">30 March 2020</div>
            <div className="expense-item__description">
                <h2>Buy Perfume</h2>
                <div className="expense-item__price">140.5</div>
            </div>
        </div>
    );
}

export default ExpenseItem;
